o=A.em('\n\u0420\u0430\u043d\u0456\u0446\u0430\u0439 \u044f \u0432\u0451\u0437 \u0441\u0432\u0430\u0439\u0433\u043e \u0441\u044f\u0440\u044d\u0434\u043d\u044f\u0433\u0430 \u0441\u044b\u043d\u0430 \u045e \u0448\u043a\u043e\u043b\u0443. \u041d\u0430 \u0441\u043a\u0440\u044b\u0436\u0430\u0432\u0430\u043d\u043d\u0456 \u0432\u0443\u043b\u0456\u0446\u044b \u0426\u0456\u043c\u0456\u0440\u0430\u0437\u0435\u0432\u0430 \u0456 \u0412\u044f\u0441\u0451\u043b\u043a\u0430\u0432\u0430\u0439 \u043c\u044b \u0441\u0442\u0430\u044f\u043b\u0456 \u043d\u0430 \u043b\u0435\u0432\u044b \u043f\u0430\u0432\u0430\u0440\u043e\u0442, \u0447\u0430\u043a\u0430\u044e\u0447\u044b \u0437\u044f\u043b\u0451\u043d\u0443\u044e \u0441\u0442\u0440\u044d\u043b\u043a\u0443. \u0406 \u044f \u0437\u043d\u043e\u045e \u0437\u0430\u045e\u0432\u0430\u0436\u044b\u045e, \u0448\u0442\u043e \u043d\u0435 \u043f\u0440\u0430\u0446\u0443\u0435 \u0437\u044f\u043b\u0451\u043d\u044b \u0441\u0456\u0433\u043d\u0430\u043b \u0441\u0432\u044f\u0442\u043b\u0430\u0444\u043e\u0440\u0430. \u041f\u0435\u0440\u0448\u044b \u0440\u0430\u0437 \u044f \u0433\u044d\u0442\u0430 \u0437\u0430\u045e\u0432\u0430\u0436\u044b\u045e \u043f\u0440\u044b\u043a\u043b\u0430\u0434\u043d\u0430 \u0437\u0430 \u0442\u044b\u0434\u0437\u0435\u043d\u044c \u0434\u0430 \u0442\u0430\u0433\u043e. \u041f\u043e\u0442\u044b\u043c \u043d\u0430\u0432\u0430\u0442 \u0437\u0440\u0430\u0431\u0456\u045e \u0437\u0434\u044b\u043c\u0430\u043a, \u043a\u0430\u0431 \u0434\u0430\u0441\u043b\u0430\u0446\u044c \u0443 115.\u0431\u0435\u043b. 115.\u0431\u0435\u043b \u2014 \u0433\u044d\u0442\u0430 \u0442\u0430\u043a\u0430\u044f \u0441\u043b\u0443\u0436\u0431\u0430 \u045e \u0411\u0435\u043b\u0430\u0440\u0443\u0441\u0456. \u042f\u043d\u0430 \u044f\u043a "\u043f\u0430\u0440\u0430\u0441\u043e\u043d" \u0434\u043b\u044f \u0443\u0441\u0456\u0445 \u043a\u0430\u043c\u0443\u043d\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u043b\u0443\u0436\u0431 \u043a\u0440\u0430\u0456\u043d\u044b. \u041b\u044e\u0431\u0443\u044e \u043a\u0430\u043c\u0443\u043d\u0430\u043b\u044c\u043d\u0443\u044e \u043f\u0440\u0430\u0431\u043b\u0435\u043c\u0443 (\u044f\u043c\u0430 \u043d\u0430 \u0434\u0430\u0440\u043e\u0437\u0435, \u043d\u0435 \u043f\u0440\u0430\u0446\u0443\u0435 \u043b\u0456\u0445\u0442\u0430\u0440, \u0441\u043c\u0435\u0446\u0446\u0435, \u043b\u044e\u043a\u0456, \u2026 \u0448\u0442\u043e \u0437\u0430\u045e\u0433\u043e\u0434\u043d\u0430) \u043c\u043e\u0436\u043d\u0430 \u043f\u0430\u0432\u0435\u0434\u0430\u043c\u0456\u0446\u044c \u0443 115, \u0430 \u0434\u044b\u0441\u043f\u0435\u0442\u0447\u0430\u0440 \u043f\u0435\u0440\u0430\u043d\u0430\u043f\u0440\u0430\u0432\u0456\u0446\u044c \u0437\u0430\u044f\u045e\u043a\u0443 \u045e \u0430\u0434\u043f\u0430\u0432\u0435\u0434\u043d\u0443\u044e \u0430\u0440\u0433\u0430\u043d\u0456\u0437\u0430\u0446\u044b\u044e. \u041d\u0430 \u0442\u043e\u0439 \u043c\u043e\u043c\u0430\u043d\u0442 \u044f \u045e\u0441\u0451 \u044f\u0448\u0447\u044d \u043d\u0435 \u0441\u0442\u0432\u0430\u0440\u044b\u045e \u0437\u0430\u044f\u045e\u043a\u0443 \u043f\u0440\u0430 \u0442\u043e\u0439 \u0441\u0432\u044f\u0442\u043b\u0430\u0444\u043e\u0440.\n\n$traffic_light\n\n\u041f\u0440\u0430\u0435\u0445\u0430\u045e 150 \u043c\u0435\u0442\u0440\u0430\u045e \u0456 \u0430\u043c\u0430\u043b\u044c \u0430\u0434\u0440\u0430\u0437\u0443 \u0437\u0430 \u043f\u0430\u0432\u0430\u0440\u043e\u0442\u0430\u043c \u043d\u0430 \u0432\u0443\u043b\u0456\u0446\u0443 \u041b\u0435\u0441\u0456 \u0423\u043a\u0440\u0430\u0456\u043d\u043a\u0456 \u045e\u0431\u0430\u0447\u044b\u045e \u043f\u0430\u0432\u0430\u043b\u0435\u043d\u044b\u044f \u0434\u0430\u0440\u043e\u0436\u043d\u044b\u044f \u0437\u043d\u0430\u043a\u0456. \u0413\u044d\u0442\u0430 \u0434\u0430\u0434\u0430\u043b\u0430 \u043c\u043d\u0435 \u043c\u0430\u0442\u044b\u0432\u0430\u0446\u044b\u0456 \u0437\u0432\u044f\u0440\u043d\u0443\u0446\u0446\u0430 \u045e 115.\u0431\u0435\u043b. \u0422\u0430\u043c\u0443 \u044f \u0437\u0430\u0432\u0451\u045e \u0441\u044b\u043d\u0430 \u045e \u0448\u043a\u043e\u043b\u0443, \u0432\u044f\u0440\u043d\u0443\u045e\u0441\u044f \u0434\u0430 \u043f\u0430\u0432\u0430\u043b\u0435\u043d\u044b\u0445 \u0437\u043d\u0430\u043a\u0430\u045e, \u043f\u0440\u044b\u043f\u0430\u0440\u043a\u0430\u0432\u0430\u045e \u043c\u0430\u0448\u044b\u043d\u0443\u2026 \u0406 \u0437\u0430\u045e\u0432\u0430\u0436\u044b\u045e, \u0448\u0442\u043e \u0451\u0441\u0446\u044c \u044f\u0448\u0447\u044d \u043f\u0440\u0430\u0431\u043b\u0435\u043c\u044b, \u043f\u0440\u0430 \u044f\u043a\u0456\u044f \u043f\u0430\u0442\u0440\u044d\u0431\u043d\u0430 \u043f\u0430\u0432\u0435\u0434\u0430\u043c\u0456\u0446\u044c \u0443 115.\n\n$issues\n\n\u0417\u0440\u0430\u0431\u0456\u045e \u0437\u0430\u044f\u045e\u043a\u0456, \u0441\u043f\u0430\u0442\u044b\u043a\u0430\u044e\u0447\u044b\u0441\u044f \u0430\u0431 \u043d\u0435\u0434\u0430\u043f\u0440\u0430\u0446\u043e\u045e\u043a\u0456 \u043f\u0430\u0440\u0442\u0430\u043b\u0430 https://115.\u0431\u0435\u043b/portal. \u041f\u043e\u0442\u044b\u043c \u0437\u0430\u043a\u0456\u043d\u0443\u045e \u0444\u043e\u0442\u0430 \u0437 \u0442\u044b\u0445 \u0437\u0430\u044f\u0432\u0430\u043a \u0443 Instagram. \u0417\u0434\u0430\u0435\u0446\u0446\u0430, \u044f \u0436\u0430\u0434\u0430\u045e \u043f\u0430\u0434\u0437\u044f\u043b\u0456\u0446\u0446\u0430 \u0437 \u043f\u0430\u0434\u043f\u0456\u0448\u0447\u044b\u043a\u0430\u043c\u0456 \u0442\u044b\u043c, \u0448\u0442\u043e "\u0442\u0430\u043a \u043c\u043e\u0436\u043d\u0430". \u041d\u0435 \u043f\u0430\u043c\u044f\u0442\u0430\u044e \u0441\u0432\u0430\u044e \u0434\u0430\u043a\u043b\u0430\u0434\u043d\u0443\u044e \u043c\u0430\u0442\u044b\u0432\u0430\u0446\u044b\u044e. \u0423 \u0442\u044b\u043c Instagram, \u044f \u043f\u0443\u0431\u043b\u0456\u043a\u0430\u0432\u0430\u045e \u0442\u043e\u043b\u044c\u043a\u0456 \u0433\u0440\u0430\u043c\u0430\u0434\u0441\u043a\u0430-\u0437\u043d\u0430\u0447\u044b\u044f \u0440\u044d\u0447\u044b. \u041d\u0430\u043a\u0448\u0442\u0430\u043b\u0442 \u0441\u0432\u0430\u0439\u0433\u043e \u0437\u0432\u0430\u0440\u043e\u0442\u0430 \u045e \u041c\u0423\u0421 \u043d\u0430\u043a\u043e\u043d\u0442 \u043f\u0430\u0434\u0440\u043e\u0431\u043a\u0456 \u0441\u0442\u0430\u0442\u044b\u0441\u0442\u044b\u043a\u0456 \u045e \u0447\u0430\u0441 \u0434\u0430\u0442\u044d\u0440\u043c\u0456\u043d\u043e\u0432\u0430\u0433\u0430 \u0433\u0430\u043b\u0430\u0441\u0430\u0432\u0430\u043d\u043d\u044f \u045e 2020 \u0433\u043e\u0434\u0437\u0435 \u0456 \u0430\u0434\u043a\u0430\u0437\u0430 \u0437 \u041c\u0423\u0421.\n\n\u0410\u0434\u0437\u0456\u043d \u0441\u0432\u044f\u0442\u043b\u0430\u0444\u043e\u0440 \u0431\u044b\u045e \u0430\u0434\u0440\u0430\u043c\u0430\u043d\u0442\u0430\u0432\u0430\u043d\u044b \u045e \u0442\u043e\u0439 \u0436\u0430 \u0434\u0437\u0435\u043d\u044c, \u0434\u0440\u0443\u0433\u0456 \u043d\u0430 \u043d\u0430\u0441\u0442\u0443\u043f\u043d\u044b \u0434\u0437\u0435\u043d\u044c. \u041f\u0440\u0430\u0432\u0430\u0434\u044b \u0431\u044b\u043b\u0456 \u0437\u0430\u0447\u044b\u043d\u0435\u043d\u044b \u043a\u0430\u0436\u0443\u0445\u043e\u043c \u043d\u0430 \u043d\u0430\u0441\u0442\u0443\u043f\u043d\u044b \u0434\u0437\u0435\u043d\u044c. \u0417\u043d\u0430\u043a\u0456 \u0431\u044b\u043b\u0456 \u045e\u0441\u0442\u0430\u043b\u044f\u0432\u0430\u043d\u044b 28 \u043b\u044e\u0442\u0430\u0433\u0430.\n\n\u042f\u043a \u0437\u0432\u044f\u0437\u0430\u043d\u044b \u0437\u0430\u044f\u045e\u043a\u0456 \u045e 115.\u0431\u0435\u043b, Instagram \u0456 i-care.by \u0441\u0442\u0430\u043d\u0435 \u0437\u0440\u0430\u0437\u0443\u043c\u0435\u043b\u0430 \u0437 \u0434\u0430\u043b\u0435\u0439\u0448\u0430\u0433\u0430 \u0430\u043f\u0430\u0432\u044f\u0434\u0430\u043d\u043d\u044f.\n',A.a([new A.ak("$traffic_light",A.hE(new A.lf(B.QQ,r,g)),q),new A.ak("$issues",A.hE(new A.lf(B.VH,r,g)),q)],p))
n=A.em('\n\u0414\u043b\u044f \u043c\u0435\u043d\u044f \u0433\u044d\u0442\u0430 \u0431\u044b\u045e \u0448\u043e\u043a. \u0414\u044b \u0456 \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u0456 \u0434\u043b\u044f \u043c\u0435\u043d\u044f. \u0417\u0434\u0430\u0435\u0446\u0446\u0430, \u0434\u043b\u044f \u043f\u0435\u0440\u0430\u0432\u0430\u0436\u043d\u0430\u0439 \u0431\u043e\u043b\u044c\u0448\u0430\u0441\u0446\u0456 \u0431\u0435\u043b\u0430\u0440\u0443\u0441\u0430\u045e. \u041d\u0456\u0445\u0442\u043e \u043d\u0435 \u0432\u0435\u0440\u044b\u045e, \u0448\u0442\u043e \u0420\u0430\u0441\u0456\u044f \u045e\u0441\u0451 \u0436 \u0442\u0430\u043a\u0456 \u043d\u0430\u043f\u0430\u0434\u0437\u0435 \u043d\u0430 \u0423\u043a\u0440\u0430\u0456\u043d\u0443. \u0413\u044d\u0442\u0430 \u0432\u044b\u0433\u043b\u044f\u0434\u0430\u043b\u0430 \u044f\u043a \u0441\u0430\u043f\u0440\u0430\u045e\u0434\u043d\u0430\u0435 \u0432\u0430\u0440\'\u044f\u0446\u0442\u0432\u0430. \u042f\u043a \u0433\u044d\u0442\u0430 \u043d\u0430\u043e\u0433\u0443\u043b \u043c\u0430\u0433\u0447\u044b\u043c\u0430\u2048 \u0411\u043e\u043b\u044c\u0448 \u0437\u0430 \u0441\u043e\u0442\u043d\u044e \u0442\u044b\u0441\u044f\u0447 \u0440\u0430\u0441\u0435\u0439\u0441\u043a\u0456\u0445 \u0441\u0430\u043b\u0434\u0430\u0442 \u043f\u0430 \u0437\u0430\u0433\u0430\u0434\u0443 \u043f\u0430\u0435\u0445\u0430\u043b\u0456 \u0437\u0430\u0431\u0456\u0432\u0430\u0446\u044c \u043c\u0456\u0440\u043d\u044b\u0445 \u0433\u0440\u0430\u043c\u0430\u0434\u0437\u044f\u043d \u0423\u043a\u0440\u0430\u0456\u043d\u044b\u2026 \u041f\u0430\u0434 "\u043b\u0435\u0433\u0435\u043d\u0434\u0430\u0439" "\u043c\u044b \u0431\u044b\u043b\u0456 \u043d\u0430 \u0432\u0430\u0439\u0441\u043a\u043e\u0432\u044b\u0445 \u0432\u0443\u0447\u044d\u043d\u043d\u044f\u0445 - \u043d\u0430\u043c \u0437\u0430\u0433\u0430\u0434\u0430\u043b\u0456 \u043d\u0435\u043a\u0443\u0434\u044b \u0435\u0445\u0430\u0446\u044c - \u043c\u044b \u043f\u0430\u0435\u0445\u0430\u043b\u0456 - \u043c\u044b \u043d\u0435 \u0432\u0435\u0434\u0430\u0435\u043c, \u0448\u0442\u043e \u0430\u043f\u044b\u043d\u0443\u043b\u0456\u0441\u044f \u0432\u0430 \u0423\u043a\u0440\u0430\u0456\u043d\u0435"\u2026 \u0422\u0430\u0434\u044b \u043c\u043d\u0435 \u0437\u0434\u0430\u0432\u0430\u043b\u0430\u0441\u044f, \u0448\u0442\u043e \u0432\u043e\u0441\u044c-\u0432\u043e\u0441\u044c \u0456 \u0433\u044d\u0442\u044b \u0436\u0430\u0445 \u0441\u043f\u044b\u043d\u0456\u0446\u0446\u0430\u2026 \u0417\u0434\u0430\u0432\u0430\u043b\u0430\u0441\u044f, \u0448\u0442\u043e \u0440\u0430\u0441\u0456\u0439\u0441\u043a\u0456\u044f \u0432\u043e\u0439\u0441\u043a\u0456 \u0437\u0430\u0440\u0430\u0437 \u0437\u0440\u0430\u0437\u0443\u043c\u0435\u0446\u044c, \u0448\u0442\u043e \u0456\u0445 \u043f\u0430\u0434\u043c\u0430\u043d\u0443\u043b\u0456 \u2014 \u043d\u0456\u044f\u043a\u0456\u044f \u0433\u044d\u0442\u0430 \u043d\u0456 \u0432\u0443\u0447\u044d\u043d\u043d\u0456\u2026 \u0417\u0434\u0430\u0432\u0430\u043b\u0430\u0441\u044f, \u0448\u0442\u043e \u0437\u0430\u0440\u0430\u0437 \u0443\u0432\u0435\u0441\u044c \u0440\u0430\u0441\u0456\u0439\u0441\u043a\u0456 \u043d\u0430\u0440\u043e\u0434 \u043f\u0430\u045e\u0441\u0442\u0430\u043d\u0435 \u0441\u0443\u043f\u0440\u0430\u0446\u044c \u0432\u0430\u0439\u043d\u044b \u0456 \u043c\u0430\u0441\u0430\u0432\u044b\u0445 \u0441\u043c\u044f\u0440\u0446\u0435\u0439 \u043d\u0430 \u0430\u0431\u043e\u0434\u0432\u0443\u0445 \u0431\u0430\u043a\u0430\u0445\u2026 \u042f\u043a\u0456 \u043d\u0430\u0456\u045e\u043d\u044b \u044f \u0431\u044b\u045e \u0442\u0430\u0434\u044b\u2026\n\n\u042d\u043c\u043e\u0446\u044b\u0456, \u044f\u043a\u0456\u044f \u0442\u0430\u0434\u044b \u0431\u044b\u043b\u0456 \u045e \u043c\u044f\u043d\u0435 \u0431\u044b\u043b\u0456 \u043f\u0430\u0434\u043e\u0431\u043d\u044b \u043d\u0430 \u0442\u044b\u0435, \u0448\u0442\u043e \u044f \u0430\u0434\u0447\u0443\u0432\u0430\u045e \u0443 \u0436\u043d\u0456\u045e\u043d\u0456 2020 \u0433\u043e\u0434\u0430, \u043a\u0430\u043b\u0456 \u043a\u0430\u0440\u043d\u0456\u043a\u0456 \u043c\u0430\u0441\u0430\u0432\u0430 \u0437\u0431\u0456\u0432\u0430\u043b\u0456 \u0456 \u043a\u0430\u0442\u0430\u0432\u0430\u043b\u0456 \u043c\u0456\u0440\u043d\u044b\u0445 \u043f\u0440\u0430\u0442\u044d\u0441\u0442\u043e\u045e\u0446\u0430\u045e \u0443 \u0411\u0435\u043b\u0430\u0440\u0443\u0441\u0456. \u0410\u0434\u0437\u0456\u043d \u0437 \u043d\u0430\u0439\u0431\u043e\u043b\u044c\u0448 \u044f\u0441\u043a\u0440\u0430\u0432\u044b\u0445 \u043c\u0430\u0456\u0445 \u0443\u0441\u043f\u0430\u043c\u0456\u043d\u0430\u045e \u043f\u0440\u0430 \u0436\u043d\u0456\u0432\u0435\u043d\u044c 20 \u0433\u043e\u0434\u0430 \u2014 \u044f \u043b\u044f\u0436\u0430\u045e \u043f\u0430\u0434 \u043a\u043e\u045e\u0434\u0440\u0430\u0439 \u0456 \u0434\u0440\u044b\u0436\u0430\u045e. \u041d\u0435 \u043c\u043e\u0433 \u0443\u0437\u043d\u044f\u0446\u0446\u0430 \u0437 \u043b\u043e\u0436\u043a\u0430 \u0437-\u0437\u0430 \u0442\u0430\u0433\u043e, \u0448\u0442\u043e \u044f \u0431\u0430\u0447\u044b\u045e \u0443 \u043d\u0430\u0432\u0456\u043d\u0430\u0445. \u041d\u0435 \u043c\u043e\u0433 \u043f\u0435\u0440\u0430\u0430\u0434\u043e\u043b\u0435\u0446\u044c \u0448\u043e\u043a. \u041f\u0430 \u045e\u0441\u043f\u0430\u043c\u0456\u043d\u0430\u0445, \u0433\u044d\u0442\u0430 \u0431\u044b\u043b\u043e \u0441\u0430 \u043c\u043d\u043e\u0439 \u043f\u0440\u044b\u043a\u043b\u0430\u0434\u043d\u0430 \u0434\u0432\u0430 \u0442\u044b\u0434\u043d\u0456. \u0417 \u043b\u0451\u0433\u043a\u0456\u043c \u0437\u0434\u0437\u0456\u045e\u043b\u0435\u043d\u043d\u0435\u043c \u0437\u0430\u0440\u0430\u0437 \u0440\u0430\u0437\u0433\u043b\u044f\u0434\u0430\u044e \u0434\u043e\u043a\u0430\u0437\u044b \u0442\u0430\u0433\u043e, \u0448\u0442\u043e \u044f \u043d\u0435\u0448\u0442\u0430 \u0440\u0430\u0431\u0456\u045e \u0443\u0436\u043e 10-\u0433\u0430 \u0436\u043d\u0456\u045e\u043d\u044f, \u0430 \u043d\u0435 \u043f\u0440\u043e\u0441\u0442\u0430 \u043b\u044f\u0436\u0430\u045e \u0443 \u043b\u043e\u0436\u043a\u0443. \u041f\u0430\u043a\u0456\u043d\u0443 \u0442\u0443\u0442 \u043d\u0435\u043a\u0430\u043b\u044c\u043a\u0456 "\u044f\u043a\u0430\u0440\u043d\u044b\u0445" \u0437\u0434\u044b\u043c\u043a\u0430\u045e \u0434\u043b\u044f \u0441\u044f\u0431\u0435 \u0441\u0430\u043c\u043e\u0433\u0430.\n\n$flashback\n\n\u041d\u0430\u043f\u044d\u045e\u043d\u0430, \u0436\u0430\u0445 \u0456 \u0448\u043e\u043a \u0431\u044b\u043b\u0456 \u0442\u0430\u043a\u0456\u044f \u043c\u043e\u0446\u043d\u044b\u044f \u043d\u0435\u043a\u0430\u0442\u043e\u0440\u044b \u0447\u0430\u0441 \u0443 \u0436\u043d\u0456\u045e\u043d\u0456, \u0448\u0442\u043e \u0456\u043d\u0448\u0430\u0435 \u0445\u043e\u0446\u044c \u0456 \u0431\u044b\u043b\u043e \u0456 \u044f \u044f\u0433\u043e \u043f\u0430\u043c\u044f\u0442\u0430\u044e, \u0430\u043b\u0435 \u0430\u0434\u043d\u0430\u0447\u0430\u0441\u043e\u0432\u0430 \u0437 \u0442\u044b\u043c, \u0431\u044b\u0446\u0446\u0430\u043c \u0431\u044b, \u0430\u043a\u0440\u0430\u043c\u044f \u0436\u0430\u0445\u0443 \u0456 \u0448\u043e\u043a\u0443 \u0456 \u043d\u0435 \u0431\u044b\u043b\u043e \u0442\u0430\u0434\u044b \u0437\u0443\u0441\u0456\u043c \u043d\u0456\u0447\u043e\u0433\u0430.\n\n\u0414\u0443\u043c\u0430\u044e, \u0443 20 \u0433\u043e\u0434\u0437\u0435 \u044f \u0430\u0442\u0440\u044b\u043c\u0430\u045e \u043f\u0440\u044b\u0448\u0447\u044d\u043f\u043a\u0443 \u0430\u0434 \u0448\u043e\u043a\u0443. "\u0417\u043c\u043e\u0433 \u043f\u0430\u0434\u043d\u044f\u0446\u0446\u0430 \u0437 \u043b\u043e\u0436\u043a\u0430". \u0422\u0430\u043c\u0443 \u045e 22 \u0433\u043e\u0434\u0437\u0435 \u045e\u043f\u043b\u044b\u045e \u0448\u043e\u043a\u0443 \u043d\u0430 \u043c\u0435\u043d\u044f \u0431\u044b\u045e \u0445\u043e\u0446\u044c \u0456 \u043c\u043e\u0446\u043d\u044b, \u0430\u043b\u0435, \u0437\u0434\u0430\u0435\u0446\u0446\u0430, \u043c\u0435\u043d\u0448\u044b \u0447\u044b\u043c \u0443 20 \u0433\u043e\u0434\u0437\u0435.\n',A.a([new A.ak("$flashback",A.hE(new A.lf(B.Tw,r,g)),q)],p))
